import React from 'react';
import './UploadRequirements.css';

const UploadRequirements=()=>{
    return(
        <div className='uploadreq-container'>
            <div className='uploadreq-rectangle'>
                <div className='uploadreq-header'><h3>Upload Requirements</h3></div>
                <input id='parent-consent' placeholder='No file uploaded'></input>
                <input id='med-cert' placeholder='No file uploaded'></input>
                <input id='psychological-exam' placeholder='No file uploaded'></input>
                <input id='resume' placeholder='No file uploaded'></input>
                <div className='pc-upload-button'><button>Upload file</button></div>
                <div className='mc-upload-button'><button>Upload file</button></div>
                <div className='pe-upload-button'><button>Upload file</button></div>
                <div className='r-upload-button'><button>Upload file</button></div>
            </div>
        </div>
    )
}

export default UploadRequirements;
